import React from "react";

const Test = () => {
    const greetingWord = "Hello";

    return (
        <span>{greetingWord}</span>
    )
  return (
    <div>
      <p>This is a Test</p>
      <p>
        Here I want to take an output: {this.some.name} and {this.some.age}
      </p>
    </div>
  );
};

export default Test;
